    // jQuery(".player-loading").length
    var getState = function() {
      if (jQuery(".legacy-controls-styles.legacy.dimmed").length > 0) {
        return 'idle';
      }
      if (jQuery(".AkiraPlayerSpinner--container").length > 0) {
        return 'loading';
      }
      if (jQuery(".nf-big-play-pause.play").length > 0) {
        return 'playing';
      } else {
        return 'paused';
      }
    };

